import PropTypes from "prop-types";

function Card({ image1 }) {
    return <div className="card">
        <img src={image1} alt="Poplloon Project" />
        <div className="card-body">
            
        </div>
    </div>
}

Card.propTypes = {
    image1: PropTypes.string,
}

export default Card;
